      "date": "1760-05-03",
      "tags_section": "30",
      "text": "30. Ben hrn. Rudolf Ramsperger an der huth, gas ist extra gutter holländer-Zaback in bleyer- nen Pfund-Büchsen à 10 Bazen, wie auch guter St. Vincent à 2 B. zu haben."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "37. Wo guter Art grosse Bohnen zum Seben, und kleine weisse dito zum Kochen in billigem Preis zu haben, ist im Berichthaus ohne Ent- geldt zu erfragen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "38. Zwey Baretlein oder Professor-huth, wie auch ein ganz neuer Casor. huth, mittlmaſsiger Grösse, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "39. Ben hrn. Burkhardt zum Riesen und extra neue grosse Italianische Zeigen, dito grosse Meertrauben mit und ohne Stiel, haselnuß- durre Morcheln, feiner Chocoladen, alles in billigem Preis zu haben."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "40. Zwoelf Sack neuer Waizen in billigem Preis, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "41. Ben hrn. Jacob Grimm Buchbinder ist zu haben: Ein Kriegs-Atlas von 65 theils Land- Karten, Städte, Plans von Bataillen und Belagerungen des jetzigen Kriegs. 2) Die Welt in einer Nuß mit Kupfern. 3) Die durchlauchtige Welt, 4 Theil mit Waapen. 4) Journal du Camp de Compiegne avec fi- gures."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "42. Zwey saubere französische Betther in ein Births- haus auf das Land oder in ein Bad dienlich, ohnentgeldlich im Berichthaus zu erfragen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "43. Eine Behausung in der Aeschemer Vorstadt mit 4 Stunden, 5 Kammern samt einer gros- sen Werkstatt, Essig und einem schönen ge- wölbten Keller und Garten, weshalb sich dev hrn. Jacob Mägdin dem Weinmann anzu- melden."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "44. Ein Freund, welcher circa 600 Seffer hanf- Saamen anders liefern könnte, möchte aber solchen vorhero verkauft wissen, offeriet selbi- gen daboro in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "45. Wo guter alter weisser Wein zu haben, ist bey Mstr. Michael Fuchs dem Küfer zu ver- nehmen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "46. Circa 6. Saum extra guter alter pur rother  Pfistner. Wein, so gut als Neuendburger oder Burgunder, in billigem Preis, im Bericht- haus zu erfragen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "47. Zwey Stüclein weissen Wein von 1756. à 8 Pfund 10 ß der Saum im einten, und à 8 Pfund im andern, wovon nach Belieben zu haben, im Berichthaus ohne Entgeldt zu er- fragen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "48. Ein Stock heu ab 7 Thänen Matten vorm Riechemer Thor oberhalb der Schorendruck. Ferner ein Stück von 17 Saumen rothen Bölltiger. Wein von 1760. schön roth-und laus- ter, im Berichthaus ohne Entgeldt zu erfas- gen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "49. Auf E. E. Junkt zum Bären sind wiederum neue Saure Rüben in billigem Preis zu haben."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "50. Ein roth Scharlachen Samissol und hosen in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "51. Im Offenburger. Hof ist wohlverwährter Bau zu haben."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "52. Ein Brennhäuslein bey der Steinen-Mühlin mit aller Kommlichkeit, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "53. Bey weme rother und weisser Burgunder / wie auch Muskat, Wein, Biccennveis wegen Mangel Plages, wie auch roth und weisser 1753ger Margräser. Wein in billigem Preis zu haben, ist im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "54. Feine heitergelde hamburger. Strick-Wollen zu haben, ist im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "55. Herren holzach des Siegrifs Behausung im Spieg-Gäßlein mit 4 Stuben, 7 Kammern, 3c. Ist entweder zu verkaufen, oder Zamethafft zu verleihen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "56. Weisse und rothe Margräser. Beine von 1760. wovon in billigem Preis nach Belieben zu haben, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "57. Ein Mannenstiiz in St. Peters Kirch auf dem Letner. Jem ein grün Tombau. Bethlein mit grünen wollenen umhängen, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "58. Ein hausschlitten mit einem schönen Bild und Zugehördt in billigem Preis, im Berichts- haus zu erfragen."
    },
    {
      "date": "1760-05-03",
      "tags_section": null,
      "text": "59. Der Bärenseifer. Hof zu St. Peter, mit Garten, Stallung, Keller 2c. wie der Augen- schein zeigen wird. Ein Ermanglung eines Käufers"
    }
  ]
}

